import React from 'react';
import Support from '../pages/support'
// import logo from './logo.svg';
// import './App.css';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';

function App() {
  return (
   <Router>
    <Switch>
    <Route path="/" exact component={Support} />
    </Switch>
   </Router>
  );
}

export default App;
